import male from "./male.svg";
import bed from "./bed.svg";
import date from "./date.svg";
import result from "./male.svg";


const imgs = {
    jpg1: require("./1.jpg"),
    jpg2: require("./2.jpeg"),
    jpg3: require("./3.jpg"),
    jpg4: require("./4.jpg"),
    jpg5: require("./5.jpg"),
    jpg6: require("./6.jpg"),
    jpg7: require("./7.jpg"),
}

const svgs ={
   maleSVG: male,
   bedSVG: bed,
   dateSVG: date,
   resultSVG: result
}
export {imgs,svgs};
